Nuo šiol bus dar paprasčiau ir greičiau užsisakyti Jūsų mėgstamus patiekalus tiesiai nuo žarijų!

Naudotis mūsų programėle verta:
- Programėlė Jus tiesiai nukreips į mūsų užsakymų sistemą;
- Užsisakykite savo mėgstamus patiekalus vos keliais paspaudimais;
- Savo lėkštę susikomponuojate Jūs patys - valgykite TIK tai kas Jums patinka;
- Galite pasirinkti Jums patogų patiekalų pristatymo bei atsiėmimo laiką!

Spauskite ir parsisiųskite! Nuo šiol bendrausime dar paprasčiau ir kokybiškiau!

Sushi Maestro
-Yra tarptautinis japonų ir Azijos virtuvės tinklas „Fast Casual“ ir „Take Away“ formatais.

-Įkelkite „SUSHI MASTER“ programą ir gaukite internetinę prieigą prie mūsų pristatymo paslaugos bet kada ir bet kur.

Užsisakykite suši pristatymą į namus arba pasiimkite suši apsilankę mūsų parduotuvėje. Naršykite išsamų meniu su kiekvieno patiekalo ingredientų aprašymais ir gražiomis nuotraukomis. Sužinokite apie akcijas, specialius pasiūlymus ir naujus produktus, taip pat perskaitykite SUSHI MASTER puslapius socialiniuose tinkluose ir pasidalinkite jais su draugais.

Naudodamiesi mūsų programa, galite:
- savarankiškai suformuoti ir apmokėti užsakymą;
- pasirinkite jums patogų mokėjimo būdą (grynaisiais arba kortele);
- nustatykite laiką, kada norėtumėte atsiimti užsakymą iš mūsų parduotuvės;
- nustatyti užsakymo pristatymo laiką;
- lengva pakartoti išankstinį užsakymą

